import React, {Componenet} from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { bio } from './robot';

const state = {
    bio: bio
}
class App extends Componenet {
    render() {
        return (
            <div className='tc'>
                <h1>RoboFriend </h1>
                <SearchBox />
                <CardList  bio={bio}/>
            </div>
        );
    }
}

 export default App;
